const AddCancel = props => {

    console.log("Add: ", props.enable)
    const enable = props.enable
    const state = "btn btn-info btn-lg " + (enable ? "":"disabled")


    return (
        <>

            <div class={state} tabindex="-1" role="button" aria-disabled="true">Add</div>
            <div class="btn btn-light btn-lg" tabindex="-1" role="button">Cancel</div>

        </>


    )
}

export default AddCancel;
